import React, {useEffect} from 'react'
import BasePageWithCard from '../BasePages/BasePageWithCard';
import SupervisedStudentsCard from '../../components/SupervisedStudentsCard/SupervisedStudentsCard'

function SupervisedStudents({teacherData, requestData, work_schedule, work_protection}) {
  useEffect(() => {
    document.title = "Курируемые выпускники";
  }, []);

  const [darkMode, setDarkMode] = useState(false);

  const toggleTheme = () => {
    setDarkMode(prevDarkMode => !prevDarkMode);
  };

  return (
    <BasePageWithCard isAuthenticated={true} data={teacherData}>
    <SupervisedStudentsCard teacherData={teacherData} requestData={requestData} work_schedule={work_schedule} work_protection={work_protection} darkMode={darkMode}/>
    </BasePageWithCard>
  )
}

export default SupervisedStudents
